import { combineReducers } from "@reduxjs/toolkit";

const itemReducer = (state = [], { type, payload }) => {
  return state;
};
const filterReducer = (state = "", { type, payload }) => {
  return state;
};

export const contactReducers = combineReducers({
  item: itemReducer,
  filter: filterReducer,
});
